import React from "react";
import { TableOfProducts } from "./TableOfProducts";
import { Boxes } from "./Boxes";
import { Sidebar } from "./Sidebar";

export const MainPage = () => {
  return (
    <div className="vh-100">
     
       
          <Sidebar />
       
        
          <Boxes />
          <TableOfProducts />
      
  

      <div className="col-12"></div>
    </div>
  );
};
